private void mergeLocalToProto() {
  if (viaProto) {
    maybeInitBuilder();
  }
  if (this.nodeAttributes != null) {
    for (NodeAttribute nodeAttribute : nodeAttributes) {
      builder.addNodeAttributes(
          ((NodeAttributePBImpl) nodeAttribute).getProto());
    }
  }
  proto = builder.build();
  viaProto = true;
}
